import React, { Component } from 'react';
import Posts from './Posts';

const Postlist = ({Posts}) => {
  return (
    <div>
    <Posts id={Posts[0].id} title={Posts[0].title} content={Posts[0].content}/>
    <Posts id={Posts[1].id} title={Posts[1].title} content={Posts[1].content}/>
    <Posts id={Posts[2].id} title={Posts[2].title} content={Posts[2].content}/>
    </div>
  );
}

export default Postlist;
